import styles from './Menu.module.scss';
import { useState } from 'react';
import MenuItem from '../MenuItem'
function Menu(props) {
    const [menu, setMenu] = useState([{ data: props.listMenu }])
    const currentMenu = menu[menu.length - 1];
    const renderMenuItem = () => {
        return currentMenu.data.map((menuItem) => {
            console.log(menuItem.icon)
            return (
                <div className={styles['row-menu']}>
                    <MenuItem icon={menuItem.icon} title={menuItem.title} />
                </div>
            )
        })
    }
    return (
       <>
           {renderMenuItem()}
        </>
    );
}

export default Menu;
